import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Dashboard from './components/Dashboard';  // Default import
import ShopPerformance from './components/ShopPerformance';
import CreatorPerformance from './components/CreatorPerformance';

const App = () => {
  return (
    <Router>
      <div>
        <h1>Dashboard</h1>
        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="/shop-performance" element={<ShopPerformance />} />
          <Route path="/creator-performance" element={<CreatorPerformance />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
